- input: "TEXT\x1CC00483693\x1C.TEXT\x1C\x1CF3XA\x1CThis report is being amended to
    include an individual contribution that was unsuccessfully imported using the
    \"Import Transactions\" tool in FECfile when we filed our March 20 Monthly report.
    The unlisted individual contribution (made by Glen Besa on 3/3/2014 for $100.00)
    was discovered by reporting staff on 5/20/2014 and promptly added to this amended
    report on schedule A. Additionally, an itemized contribution originally listed
    on line 11(a) of Schedule A in the amount of $250.00 from Kurt Fritts on 3/7/2014
    has been removed due to an error in recording the name of the donor. The $250.00
    amount was recorded twice and the correct donor (DLCC) was already listed originally
    and will not be changed. \n"
